-- ----------------------------
-- Table structure for sys_medical_record
-- ----------------------------
DROP TABLE IF EXISTS `sys_medical_record`;
CREATE TABLE `sys_medical_record`  (
  `record_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '记录编号',
  `user_id` bigint(20) NULL DEFAULT NULL COMMENT '用户ID',
  `md` double(5, 2) NULL DEFAULT NULL COMMENT 'MD值',
  `psd` double(5, 2) NULL DEFAULT NULL COMMENT 'PSD值',
  `bh` double(5, 2) NULL DEFAULT NULL COMMENT '杯盘比值',
  `um` double(5, 2) NULL DEFAULT NULL COMMENT '角膜厚度',
  `rnfl` double(5, 2) NULL DEFAULT NULL COMMENT 'RNFL值',
  `medical_time` datetime(0) NULL DEFAULT NULL COMMENT '就诊日期',
  `hospital` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '就诊医院',
  `remark` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`record_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 103 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '就诊记录表' ROW_FORMAT = Dynamic;

