  `drugs_end_time` datetime(0) NULL DEFAULT NULL COMMENT '药物治疗结束时间',
  `laser` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '激光治疗',
