DROP TABLE IF EXISTS `sys_user_info`;
CREATE TABLE `sys_user_info`  (
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `diagnosis` datetime(0) NULL DEFAULT NULL COMMENT '确诊日期',
  `birthday` datetime(0) NULL DEFAULT NULL COMMENT '出生日期',
  `vision_left` double(5, 1) NULL DEFAULT NULL COMMENT '左眼视力',
  `vision_right` double(5, 1) NULL DEFAULT NULL COMMENT '右眼视力',
  `history` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '无' COMMENT '家族史',
  `archives` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '青光眼档案',
  `pressure` int(10) NULL DEFAULT NULL COMMENT '眼压',
  `photo` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '确诊照片',
  `stress` int(10) NULL DEFAULT NULL COMMENT '感知压力量表分数',
  `compliance` double(5, 1) NULL DEFAULT NULL COMMENT '药物依从性量表分数',
  `nick_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '昵称',
  `avatar` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像地址',
  `sex` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '性别',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '个人信息表' ROW_FORMAT = Dynamic;

